import React from 'react';
import styled from 'styled-components';
import NaverLogin from 'react-naver-login';
import naverLogin from '../../build/static/images/네이버 아이디로 로그인_완성형_White.PNG';
import key from '../../key.json';
const Button = styled(NaverLogin)`
    position : relative;
    background-image : url(${naverLogin});
    background-size : cover;
    background-position: center;
    background-repeat: no-repeat;
    outline : none;
border: none;
width: 300px;
height : 49px;
left : 15%;
margin-bottom : 1.5rem;
`;


const NaverLoginButton = ({responseNaver,responseNaverFail}) => {
    return(
    <div>
        <Button clientId={key.naverKey}
                callbackUrl="http://localhost:3000/auth/login"
                onSuccess={responseNaver}
                onFailure={responseNaverFail}
                />
    </div>
    );
    }
    export default NaverLoginButton;
